    public Order order = new Order();
    public IEnumerable<OrderViewModel> orderview = new List<OrderViewModel>();
    protected async override Task OnInitializedAsync()
    {
        List<OrderViewModel> list = new List<OrderViewModel>();
        var orders = await order_services.GetByWarehouse(1);
        var warehouse = await warehouse_services.GetWarehouse(new WarehouseIdDTO { Id = 1 });
        var clients = await client_services.GetClients();
        var products = await product_services.GetProducts();
        foreach (var o in orders)
        {
            list.Add(new OrderViewModel
            {
                Id = o.Id,
                ClientId = o.ClientId,
                ProductId = o.ProductId,
                ProductAmount = o.ProductAmount,
                WarehouseId = o.WarehouseId,
                Cost = o.Cost,
                ProductName = products.Where(p => p.Id == o.ProductId).FirstOrDefault().Name,
                ClientName = clients.Where(c => c.Id == o.ClientId).FirstOrDefault().Name,
                ClientAddress = clients.Where(c => c.Id == o.ClientId).FirstOrDefault().Address,
                WarehouseName = warehouse.Name
            });
        }
        orderview = list;
    }
    private async Task FormSubmit(EditContext editContext)
    {
        order.WarehouseId = 1;
        Stock stock = new Stock();
        {
            var stocks = await stock_services.GetByProduct(order.ProductId);
            stock = stocks[0];
        }
        order.Cost = order.ProductAmount * stock.SellPrice;
        await order_services.AddOrder(new OrderDTO {
            ClientId = order.ClientId,
            ProductId = order.ProductId,
            ProductAmount = order.ProductAmount,
            WarehouseId = order.WarehouseId,
            Cost = order.Cost
        });
        uriHelper.NavigateTo(uriHelper.Uri, forceLoad: true);
    }

